import { Component } from 'react';
import { render } from '@testing-library/react';

class App extends Component{
 constructor(props){
  super(props);
  this.props=props;
  this.state={
    classs: [
      {name: 'sakshi Gupte',
        age: 26
      },
      {
        name: 'rupali prabha',
        age: 25
      },
      {
        name: 'Naveen',
        age: 45
      },
      {
        name: 'hemant',
        age:  34
      },
      {
        name: 'rahul',
        age: 50
      }
    ]
  }

 }


    render(){
      let parsons = this.state.classs.map((t)=>{
        return(
         < Cl name={t.name} age={t.age}/>
        )

      }
    )

      return(<div>
       {parsons}
       </div>
      )


    }
  }


export default App;
